import React, { useState } from "react";
import axios from "axios";
import styles from "./LoanForm.module.css";

const LoanForm = () => {
  const [data, setData] = useState({
    Full_Name: "",
    Address: "",
    PAN_Number: "",
    Company_Name: "",
    Current_Salary: "",
    Previous_Salary: "",
    Owns_House: "",
    Rent_Amount: "",
    Grocery_Expense: "",
    Current_EMIs: "",
    Date_Previous_Hike: "",
    Date_Next_Hike: "",
    Bank_Name: "",
    Credit_Score: "",
    Number_of_Credit_Cards: "",
    Total_Credit_Limit: "",
    Number_of_Loans: "",
    Employment_Duration: "",
    Job_Title: "",
    Bonuses_Allowances: "",
    Savings: "",
    Investments: "",
    Monthly_Expenses: "",
    Age: "",
    Education_Level: "",
    Marital_Status: "",
    Dependents: "",
    Loan_Purpose: "",
    Requested_Loan_Amount: "",
    Preferred_Repayment_Period: "",
    Mall_Visits_Per_Month: "",
    Mall_Spend_Average: ""
  });

  const [result, setResult] = useState(null);

  const changeHandler = (e) => {
    setData({ ...data, [e.target.name]: e.target.value });
  };

  const submitHandler = async (e) => {
    e.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:5000/predict', data);
      setResult(response.data);
    } catch (error) {
      console.error("Error submitting form: ", error);
    }
  };

  return (
    <div className={styles.container}>
      <form onSubmit={submitHandler}>
        <h2>Loan Eligibility Form</h2>
        {/* Create input fields dynamically */}
        {Object.keys(data).map((key) => (
          <div key={key}>
            <label>{key.replace(/_/g, " ")}</label>
            <input type="text" name={key} value={data[key]} onChange={changeHandler} />
          </div>
        ))}
        <button type="submit">Check Eligibility</button>
      </form>
      {result && (
        <div className={styles.result}>
          <h3>Loan Prediction Result</h3>
          {result.Eligibility ? (
            <div>
              <p>Eligible for Loan</p>
              <p>Requested Loan Amount: {result.Requested_Loan_Amount}</p>
              <p>Preferred Repayment Period: {result.Preferred_Repayment_Period} months</p>
              <p>EMI: {result.EMI}</p>
              <p>Risk Score: {result.Risk_Score}</p>
            </div>
          ) : (
            <p>Not Eligible for Loan</p>
          )}
        </div>
      )}
    </div>
  );
};

export default LoanForm;
